pragma solidity ^0.8.0;

/*
//合约调用部分第一种
contract SimpleStorage{
    uint favoriteNumber;
    struct People{
        uint age;
        string name;

    }
    mapping (string => uint) public NameToAge;
    
    People[] public person;

    function store(uint _favoriteNumber) public{
        favoriteNumber = _favoriteNumber;
